import React, { Component } from "react";

class News extends Component {
  constructor(props) {
    super(props);
    this.state = {
      articles: []
    };
  }

  componentDidMount() {
    let articleRequests = new Request("http://finance.yahoo.com/rss/");
    fetch(articleRequests).then(res =>
      res.txt().then(str => {
        this.setState({
          isLoaded: true,
          items: str
        });
      })
    );
  }

  render() {
    return <div>This is news</div>;
  }
}

export default News;
